Boss::Boss() : x(500), y(550), active(true), bulletActive(false), life(400)
{
    std::cout << "Boss created at (" << x << ", " << y << ")\n";
}

void Boss::drawSqua(float _x, float _y, float size) const
{
    _x = _x * size + x;
    _y = _y * size + y;
    glBegin(GL_QUADS);
    glVertex2f(_x, _y);
    glVertex2f(_x + size, _y);
    glVertex2f(_x + size, _y + size);
    glVertex2f(_x, _y + size);
    glEnd();
}

void Boss::drawSquaBullet(float _x, float _y, float size) const
{
    _x = _x * size + x;
    _y = _y * size + y;
    glBegin(GL_QUADS);
    glVertex2f(_x, _y);
    glVertex2f(_x + size, _y);
    glVertex2f(_x + size, _y - size);
    glVertex2f(_x, _y - size);
    glEnd();
}

void Boss::draw() const
{
    if (active)
    {
        for (int i = 0; i < 71; i++)
        {
            for (int j = 0; j < 62; j++)
            {
                if (vectorBoss[i][j] != 0xffacacac)
                {
                    glColor3f(((vectorBoss[i][j] >> 16) & 0xFF) / 255.0f, ((vectorBoss[i][j] >> 8) & 0xFF) / 255.0f, (vectorBoss[i][j] & 0xFF) / 255.0f);
                    drawSqua(j, 70 - i);
                }
            }
        }
    }
}

void Boss::drawBullet() const
{
    if (bulletActive)
    {
        glColor3f(1.0f, 1.0f, 0.0f);
        glBegin(GL_QUADS);
        glVertex2f(x + 140, y);
        glVertex2f(x + 170, y);
        glVertex2f(x + 170, y - BULLET_HEIGHT);
        glVertex2f(x + 140, y - BULLET_HEIGHT);
        glEnd();
    }
}

float Boss::getX() const { return x; }
float Boss::getY() const { return y; }
bool Boss::isActive() const { return active; }
void Boss::setActive(bool state) { active = state; }

bool Boss::checkCollision(int xOffset) const
{
    int defenderInicio = xOffset;
    int defenderFin = xOffset + 81;
    int balaInicio = x + 140;
    int balaFin = x + 175;

    return (balaInicio <= defenderFin && balaFin >= defenderInicio) && bulletActive;
}

void Boss::decreaseLife()
{
    life -= 50;
    std::cout << "Boss life: " << life << "\n";
    if (life <= 0)
    {
        active = false;
    }
}

void Boss::attack()
{
    while (active)
    {
        std::this_thread::sleep_for(std::chrono::milliseconds(1000));
        bulletActive = true;
        std::this_thread::sleep_for(std::chrono::milliseconds(1000));
        bulletActive = false;
    }
}

void Boss::move(float speed)
{
    while (active)
    {
        x += speed;
        if (x > 1320)
        {
            x = 0;
        }
        std::this_thread::sleep_for(std::chrono::milliseconds(100));
    }
}